import React, { Component } from 'react';
//import api from '../../services/api';

import './styles.css';

export default class addProduct extends Component {
    state = {
        product: {},
    };

    render() {
        return (
            <div className="product-info">
                <form id="add-product">
                    <label>Título</label><br/>
                    <input id="product-input" placeholder="Ex. iPhone" name="title"></input><br/>
                    <label>Descrição</label><br/>
                    <input id="product-input" placeholder="Ex. Most popular mobile phone" name="description"></input><br/>
                    <label>URL</label><br/>
                    <input id="product-input" placeholder="Ex. https://example.com" name="url"></input><br/>
                    <button>Adicionar</button>
                </form>
            </div>
        );
    }
}
